import { Component, Input } from '@angular/core';
import { FormGroup, FormControl, Validators } from '@angular/forms';
import { RegisterService } from 'src/app/services/register.service';

export interface RegisterForm{
  name: string;
  phoneNumber: string;
  whatsappNumber: string;
  college: string;
  branch: string;
  semester: number;
  address: string;
  email: string;
  parentNumber:string;
  cid: number;
  cname: string;
}

@Component({
  selector: 'app-register-form',
  templateUrl: './register-form.component.html',
  styleUrls: ['./register-form.component.css']
})
export class RegisterFormComponent {
    form= new FormGroup({
    name:  new FormControl<any>(null,Validators.required),
    phoneNumber: new FormControl<any>(null,[Validators.required, Validators.pattern("^((\\+91-?)|0)?[0-9]{10}$")]),
    whatsappNumber: new FormControl(<any>null,Validators.required),
    college: new FormControl<any>(null,Validators.required),
    branch: new FormControl<any>(null,Validators.required),
    semester: new FormControl<any>(null,Validators.required),
    address: new FormControl<any>(null,Validators.required),
    parentNumber:new FormControl<any>(null,Validators.required),
    email: new FormControl<any>(null,[Validators.required,Validators.email]),
    course:new FormGroup({
      cid: new FormControl()
    })
    
 }
 )
  
 registerform:RegisterForm;

constructor( private registerService:RegisterService){}
   
 getdata($event)
{
 let dta=this.registerform=$event;
  
}


postdata(data:any){
  if(this.registerService.getData()){
    this.registerService.postregister(this.registerService.getData(),(retval:any)=>{
    console.log(retval);
    alert("data sent successfully");
    })
  }else{
    this.registerService.postregister( data,(retval:any)=>{
      console.log(retval);
      alert("data sent successfully");
      })
  }
}
 public get name(){
  return this.form.get('name');
}
public get phoneNumber(){
  return this.form.get('phoneNumber');
}
public get email(){
  return this.form.get('email');
}
public get course(){
  return this.form.get('course');
}
public get cid(){
  return this.form.get('course')?.get('cid');
}

public get whatsappNumber(){
  return this.form.get('whatsappNumber');
}

public get semester(){
  return this.form.get('semester');
}
public get branch(){
  return this.form.get('branch');
}
public get college(){
  return this.form.get('college');
}
public get parentNumber(){
  return this.form.get('parentNumber');
}
public get address(){
  return this.form.get('address');
}


}

<div class="container">
   <app-otp-verify></app-otp-verify>
    <form [formGroup]="form" #f="ngForm" >
        <h3 class="text-center">Registration form</h3><br><br>
        <div class="fg">
            <label for="name" class="form-label" >Name</label>
            <input formControlName="name" type="text" class="form-control" id="name" value="123" name="name">
        </div>
        <div class="fg">
            <label for="phoneNumber" class="form-label" >Phone Number</label>
            <input formControlName="phoneNumber" type="text" class="form-control" id="phoneNumber" value="1323" name="phoneNumber">
        </div>
        <div class="fg">
            <label for="whatsappNumber" class="form-label" >WhatsApp Number</label>
            <input  type="text" class="form-control" id="whatsappNumber" [value]="whatsappNumber.value" name="whatsappNumber">
        </div>
        <div class="fg">
            <label for="college" class="form-label" >College</label>
            <input  type="text" class="form-control" id="college"  [value]="college.value"name="college">
        </div>
        <div class="fg">
            <label for="branch" class="form-label" >Branch</label>
            <input formControlName="branch" type="text" class="form-control" id="branch" [value]="branch" name="branch">
        </div>
        <div class="fg">
            <label for="semester" class="form-label" >Semester</label>
            <input formControlName="semester" type="text" class="form-control" id="semester" [value]="semester" name="semester">
        </div>
        <div class="fg">
            <label for="address" class="form-label" >Address</label>
            <input formControlName="address" type="text" class="form-control" id="address" [value]="address" name="address">
        </div>
        <div class="fg">
            <label for="email" class="form-label" >Email</label>
            <input formControlName="email" type="text" class="form-control" id="email" [value]="email" name="email">
        </div>
        <div class="fg">
            <label for="parentNumber" class="form-label" >Parent Number</label>
            <input formControlName="parentNumber" type="text" class="form-control" id="parentNumber" [value]="parentNumber" name="parentNumber">
        </div>
        <br>


        <div>
            <button class="btn btn-primary" type="submit" (click)="postdata(f.value)" >Submit</button><br>

        </div>
    </form>
</div>
